import React from 'react';
import './App.css';

import {
  BrowserRouter as Router,
  Route,
  Switch,
  Link,
  Redirect
} from "react-router-dom";

//pages
import MainPage from "./Visualizers";
import PathfindingVisualizer from './Visualizers/PathfindingVisualizer/PathfindingVisualizer';
import PathfinderDragon from './Visualizers/PathfinderDragon/PathfinderDragon';

function App() {
  return (
    <body>
      <Router>
        <Switch>
          <Route exact path="/" component={MainPage} />
          <Route exact path="./PathfindingVisualizer/PathfindingVisualizer.jsx" component={PathfindingVisualizer} />
          <Route exact path="./PathfinderDragon/PathfinderDragon.jsx" component={PathfinderDragon} />
        </Switch>
      </Router>
    </body>
  );
}

export default App;
